import React from "react";
import Header from "../../Components/header";
import "./style.css";
export default function SignIn() {
  return (
    <div className="signin_wrapper">
      <Header />
      <div className="signin_content">
        <div className="signin_col1">
          <span style={{ fontWeight: 600, fontSize: "30px" }}>
            Customer Sign In
          </span>
          <div className="line"></div>
          <span>If you have an account, sign in with your email address.</span>
          <div className="input_field_wrapper">
            <span className="input_label">Last Name *</span>
            <input type="text" className="ship_input" />
          </div>
        </div>
      </div>
    </div>
  );
}
